import logo from "./logo.svg";
import "./App.css";
import Logo from "./";

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <div className="img_logo">
          <img src={Logo}>Logo</img>
        </div>
      </header>
      <nav className="nav">
        <div>
          <a>Profile</a></div>
        <div>
        <a>Messages</a>
        </div>
        <div>
        <a>News</a></div>
        <div>
        <a>Music</a></div>
        <div><a>Settings</a></div>
      </nav>
      <div className="content">Main content</div>
    </div>
  );
};

export default App;
